  false,\n\t\"url\": null,\n\t\"notes\": \"This survey provides a direct assessment
  of response to management actions on bobolink, which is a wet meadow-associated
  migratory bird species. The justification of this survey is to estimate population
  trends of bobolink in areas known to support high densities of bobolink.  It is
  a legacy survey that continues due to the popularity of public participation in
  counting this charismatic species. The landbird point count for wet meadows supplements
  this data and provides information on relative abundance and distribution of bobolink
  in the southern Blitzen Valley.\",\n\t\"license_title\": \"License Not Specified\",\n\t\"extras\":
